import React from 'react';
import {Admin, Resource, EditGuesser, ShowGuesser} from 'react-admin';
import {RoleList, RoleCreate, RoleEdit} from './role';
import {User_allList, User_allEdit} from './user_all';
import {RightList, RightCreate, RightEdit} from './right';
import myDataProvider from "./api/dataProvider";
import mySvg from './logo.svg'
import langProvider from "./lang/langProvider";
import CustomLayout from "./CustomLayout";
import {ProfilList, ProfilEdit} from "./students";
import {StudiumEdit, StudiumList} from "./studies";
import {AccountList, AccountEdit} from "./accounts";
import {StaffEdit, StaffList, StaffCreate} from "./staff";


require('dotenv').config();
/**
 *
 * REACT ADMIN AND ALL REQUIRED COMPONENT
 *
 * @returns {*}
 * @constructor
 */

const App = () => <div style={{width: '95%'}}>

    <div style={{width: '100%'}}>
        <Admin dataProvider={myDataProvider}
               i18nProvider={langProvider}
               layout={CustomLayout}>
            <Resource name="students" list={ProfilList} edit={ProfilEdit}/>
            <Resource name="studies"    list={StudiumList} edit={StudiumEdit}/>
            <Resource name="persons"    list={StaffList} edit={StaffEdit} create={StaffCreate}/>
            <Resource name="accounts" list={AccountList} edit={AccountEdit} />
            <Resource name="csph" />
            <Resource name="role" list={RoleList} create={RoleCreate} edit={RoleEdit}/>
            <Resource name="right" list={RightList} create={RightCreate} edit={RightEdit} />
            <Resource name="user_role"/>
            <Resource name="role_right"/>
        </Admin>
        <div className='footer'>
            <img src={mySvg} alt={mySvg} width={100} height={100}/>
        </div>
    </div>
</div>;

export default App

